title: PaginatedResultsOfEvaluation
type: object
description: 'Gets a collection of Evaluations, within a given range.'
properties:
  results:
    type: array
    description: 'List of evaluations'
    items:
      $ref: 'Evaluation.yaml'
  totalNumberOfResults:
    description: 'Number of results per page'
    type: integer
